package com.efrobot.paylibrary;import android.os.Parcel;import android.os.Parcelable;/** * Created by zhangyun on 2016/10/24. */public class PayResult implements Parcelable {    /**     * 支付结果的状态.     */    private String resultCode;    /**     * 返回响应信息.     */    private String data;    /**     * 开放平台分配给开发者的应用ID.     */    private String appId;    /**     * 开放平台账户ID.     */    private String devId;    /**     * 请求结果返回时间：yyyy-MM-dd HH:mm:ss.     */    private String timestamp;    /**     * 商户网站唯一订单号.     */    private String outTradeNo;    /**     * 该交易在进化者机器人系统中的交易流水号.     */    private String tradeNo;    /**     * 该笔订单的资金总额，精确到小数点后两位.     */    private String totalAmount;    public PayResult() {    }    /**     * 获取请求状态.     *     * @return 请求状态     */    public String getResultCode() {        return resultCode;    }    public void setResultCode(String resultCode) {        this.resultCode = resultCode;    }    /**     * 获取返回响应信息.     *     * @return     */    public String getData() {        return data;    }    /**     * 获取开放平台分配给开发者的应用ID.     *     * @return     */    public String getAppId() {        return appId;    }    /**     * 获取开放平台账户ID.     *     * @return     */    public String getDevId() {        return devId;    }    /**     * 获取请求结果返回时间：yyyy-MM-dd HH:mm:ss.     *     * @return     */    public String getTimestamp() {        return timestamp;    }    /**     * 获取商户网站唯一订单号.     *     * @return     */    public String getOutTradeNo() {        return outTradeNo;    }    /**     * 获取该交易在进化者机器人系统中的交易流水号.     *     * @return     */    public String getTradeNo() {        return tradeNo;    }    /**     * 获取该笔订单的资金总额，精确到小数点后两位.     *     * @return     */    public String getTotalAmount() {        return totalAmount;    }    public void setData(String data) {        this.data = data;    }    public void setAppId(String appId) {        this.appId = appId;    }    public void setDevId(String devId) {        this.devId = devId;    }    public void setTimestamp(String timestamp) {        this.timestamp = timestamp;    }    public void setOutTradeNo(String outTradeNo) {        this.outTradeNo = outTradeNo;    }    public void setTradeNo(String tradeNo) {        this.tradeNo = tradeNo;    }    public void setTotalAmount(String totalAmount) {        this.totalAmount = totalAmount;    }    public static Creator<PayResult> getCREATOR() {        return CREATOR;    }    public PayResult(Parcel in) {        resultCode = in.readString();        data = in.readString();        appId = in.readString();        devId = in.readString();        timestamp = in.readString();        outTradeNo = in.readString();        tradeNo = in.readString();        totalAmount = in.readString();    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeString(resultCode);        dest.writeString(data);        dest.writeString(appId);        dest.writeString(devId);        dest.writeString(timestamp);        dest.writeString(outTradeNo);        dest.writeString(tradeNo);        dest.writeString(totalAmount);    }    public static final Creator<PayResult> CREATOR = new Creator<PayResult>() {        @Override        public PayResult createFromParcel(Parcel source) {            PayResult payresult = new PayResult(source);            return payresult;        }        @Override        public PayResult[] newArray(int size) {            return new PayResult[0];        }    };    @Override    public String toString() {        return "PayResult{" +                "resultCode='" + resultCode + '\'' +                ", data='" + data + '\'' +                ", appId='" + appId + '\'' +                ", devId='" + devId + '\'' +                ", timestamp='" + timestamp + '\'' +                ", outTradeNo='" + outTradeNo + '\'' +                ", tradeNo='" + tradeNo + '\'' +                ", totalAmount='" + totalAmount + '\'' +                '}';    }}